@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);
#A_1 {
    box-sizing: border-box;
    color: rgba(255, 255, 255, 0.83);
    text-align: left;
    text-decoration: none solid rgba(255, 255, 255, 0.83);
    text-rendering: optimizeLegibility;
    text-shadow: rgba(0, 0, 0, 0.43) 0px 0px 1px;
    text-size-adjust: 100%;
    white-space: nowrap;
    column-rule-color: rgba(255, 255, 255, 0.83);
    perspective-origin: 0px 0px;
    transform-origin: 0px 0px;
    caret-color: rgba(255, 255, 255, 0.83);
    border: 0px none rgba(255, 255, 255, 0.83);
    font: normal normal 700 normal 32px / 32px "Open Sans", sans-serif;
    outline: rgba(255, 255, 255, 0.83) none 0px;
}/*#A_1*/

#A_1:after {
    box-sizing: border-box;
    color: rgba(255, 255, 255, 0.83);
    text-align: left;
    text-decoration: none solid rgba(255, 255, 255, 0.83);
    text-rendering: optimizeLegibility;
    text-shadow: rgba(0, 0, 0, 0.43) 0px 0px 1px;
    text-size-adjust: 100%;
    white-space: nowrap;
    column-rule-color: rgba(255, 255, 255, 0.83);
    caret-color: rgba(255, 255, 255, 0.83);
    border: 0px none rgba(255, 255, 255, 0.83);
    font: normal normal 700 normal 32px / 32px "Open Sans", sans-serif;
    outline: rgba(255, 255, 255, 0.83) none 0px;
}/*#A_1:after*/

#A_1:before {
    box-sizing: border-box;
    color: rgba(255, 255, 255, 0.83);
    text-align: left;
    text-decoration: none solid rgba(255, 255, 255, 0.83);
    text-rendering: optimizeLegibility;
    text-shadow: rgba(0, 0, 0, 0.43) 0px 0px 1px;
    text-size-adjust: 100%;
    white-space: nowrap;
    column-rule-color: rgba(255, 255, 255, 0.83);
    caret-color: rgba(255, 255, 255, 0.83);
    border: 0px none rgba(255, 255, 255, 0.83);
    font: normal normal 700 normal 32px / 32px "Open Sans", sans-serif;
    outline: rgba(255, 255, 255, 0.83) none 0px;
}/*#A_1:before*/
